import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import './index.css'; // 스타일링 (선택 사항)

// React 18 버전 기준으로 root 생성
const root = ReactDOM.createRoot(document.getElementById('root'));

// 애플리케이션을 DOM에 렌더링
root.render(
    <React.StrictMode>
        <App />
    </React.StrictMode>
);
